  \"2015-11-25T17:38:25.245172\",\n\t\"name\": \"oco-2-level-2-spatially-ordered-geolocated-retrievals-of-xco2-and-fluorescence-using-the-i\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Orbiting Carbon Observatory is the first
  NASA missionndesigned to collect space-based measurements of atmospheric carbon
  dioxidenwith the precision, resolution, and coverage needed to characterize thenprocesses
  controlling its buildup in the atmosphere. The OCO-2 project usesnthe LEOStar-2
  spacecraft that carries a single instrument. It incorporatesnthree high-resolution
  spectrometers that make coincident measurements ofnreflected sunlight in the near-infrared
  CO2 near 1.61 and 2.06 u03bcm and innmolecular oxygen (O2) A-Band at 0.76 u03bcmnnThis
  collection encompass the output from the IMAP-DOAS preprocessor, which is used for
  both screening of the official XCO2 product as well as for the retrieval of Solar-Induced
  Fluorescence from the 0.76 um O2 A-band. The IMAP-DOAS preprocessor, just as the
  ABO2 cloud screen, is implemented in the operational OCO-2 processing pipeline.\",\n\t\"license_title\":
